import React, { Component } from 'react'
import Index from '../index'
import ContentStaff from '../../components/ContainerComponents/staff/ContentStaff'

export class Staff extends Component {
    constructor(props) {
        super(props)
    }
    render(){
        return (
            <Index>
                <ContentStaff/>
            </Index>
        )
    }
}

export default Staff
